import React, { Component, Fragment  } from 'react';
import { Link } from 'react-router-dom';
import Logout from "./logout.component";
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

class Navbar extends Component {

    static propTypes = {
        auth: PropTypes.object.isRequired
    }

    render() {
        const { isAuthenicated, user }= this.props.auth;

        const authLinks = (
            <Fragment>
            </Fragment>
        )
        return (
            <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
                <Link to="/" className="navbar-brand">ExRoutine</Link>
                <div className="collapse navbar-collapse">
                    <ul className="navbar-nav mr-auto">
                        <li className="navbar-item">
                            <Link to="/routines" className="nav-link">My Routines</Link>
                        </li>
                        <li className="navbar-item">
                            <Link to="/create" className="nav-link">Create Routine</Link>
                        </li>
                        <li className="navbar-item">
                            <Link to="/user" className="nav-link">Create User</Link>
                        </li>
                        <li className="navbar-item">
                            <Link to="/login" className="nav-link">Login</Link>
                        </li>
                        <li className="navbar-item">
                        <Logout/>
                        </li>
                    </ul>
                </div>
            </nav>
        )
    }
}

const mamStateToProps = state =>({
    auth: state.auth
});

export default conect(mapStateToProps, null)(Navbar);
